const { SlashCommandBuilder } = require('@discordjs/builders');
const { REST } = require('@discordjs/rest');
const { CommandInteraction, ApplicationCommandOptionType, EmbedBuilder } = require('discord.js');

const clientId = process.env.CLIENT_ID;
const guildId = process.env.GUILD_ID;

const commands = [
  new SlashCommandBuilder()
    .setName('ban')
    .setDescription('Bans a user')
    .addUserOption(option =>
      option.setName('user').setType(ApplicationCommandOptionType.User).setRequired(true))
    .addStringOption(option =>
      option.setName('reason').setDescription('Reason for banning').setRequired(false))
];

(async () => {
  try {
    const rest = new REST({ version: '10' }).setToken(process.env.BOT_TOKEN);

    // Register the commands
    await rest.put(
      Routes.applicationGuildCommands(clientId, guildId),
      { body: commands },
    );
    console.log('Successfully registered application commands.');
  } catch (error) {
    console.error(error);
  }
})();
```

#### 5. Create the Ban Command Handler

Now, create a handler for the `ban` command that bans the specified user with an optional reason:

```javascript
const { CommandInteraction } = require('discord.js');
const { EmbedBuilder } = require('discord.js');
const { Client, GatewayIntentBits, Partials } = require('discord.js');

const client = new Client({
  intents: [GatewayIntentBits.Guilds, GatewayIntentBits.GuildMembers, GatewayIntentBits.GuildMessages],
  partials: [Partials.Channel],
});

client.on('ready', async () => {
  console.log(`Logged in as ${client.user.tag}`);
});

client.on('interactionCreate', async interaction => {
  if (!interaction.isCommand()) return;

  if (interaction.commandName === 'ban') {
    const user = interaction.options.getUser('user');
    const reason = interaction.options.getString('reason');

    if (!user) {
      await interaction.reply({ content: 'Please provide a user.', ephemeral: true });
      return;
    }

    try {
      await interaction.guild.members.ban(user.id, { reason: reason || 'No reason provided.' });

      const embed = new EmbedBuilder()
        .setColor(0xFF0000)
        .setTitle('User Banned')
        .setDescription(`**User:** ${user.username}\n**Reason:** ${reason || 'No reason provided.'}\n**Moderator:** ${interaction.user.username}`);

      await interaction.reply({ content: 'User banned successfully.', ephemeral: true });
      await interaction.channel.send({ embeds: [embed] });
    } catch (error) {
      await interaction.reply({ content: 'Failed to ban the user.', ephemeral: true });
      console.error(error);
    }
  }
});

client.login(process.env.BOT_TOKEN);
```

