To determine whether a given integer `n` is a power of three without using loops or recursion, we can use logarithms. The idea is to check if the base-3 logarithm of `n` is an integer. Here’s a Java solution that implements this approach:

```java
public class PowerOfThreeChecker {

    public static boolean isPowerOfThree(int n) {
        // Check if n is less than 1, which cannot be a power of three
        if (n < 1) {
            return false;
        }

        // Calculate log base 3 of n
        double logBase3 = Math.log(n) / Math.log(3);

        // Check if the result is an integer
        return logBase3 == Math.floor(logBase3);
    }

    public static void main(String[] args) {
        // Test cases
        System.out.println(isPowerOfThree(27)); // true
        System.out.println(isPowerOfThree(0));  // false
        System.out.println(isPowerOfThree(-1)); // false
        System.out.println(isPowerOfThree(9));  // true, because 9 = 3^2
        System.out.println(isPowerOfThree(45)); // false
    }
}
```

### Explanation:
1. **Initial Check**: If `n` is less than 1, it cannot be a power of three, so we immediately return `false`.
2. **Logarithmic Calculation**: We calculate the logarithm base 3 of `n` using the formula `Math.log(n) / Math.log(3)`. This gives us the exponent \(x\) in the equation \(3^x = n\).
3. **Integer Check**: We then check if the calculated exponent is an integer by comparing it to its floor value (`Math.floor(logBase3)`). If they are equal, it means \(n\) is indeed a power of three.

