### Step-by-Step Program

1. **Open the File**: The program will open the file for reading.
2. **Read Line-by-Line**: It will read each line of the file one by one.
3. **Tokenize Each Line**: Split each line into words.
4. **Count Occurrences**: Count how many times the specified word appears in the entire file.
5. **Close the File**: Close the file after processing.

Here is the complete code:

```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <sstream>

int countWordOccurrences(const std::string& filePath, const std::string& wordToCount) {
    int count = 0;
    std::ifstream file(filePath);

    if (!file.is_open()) {
        std::cerr << "Failed to open the file." << std::endl;
        return -1;
    }

    std::string line;
    while (std::getline(file, line)) {
        // Tokenize the line into words using stringstream
        std::istringstream iss(line);
        std::string token;
        while (iss >> token) {
            // Convert to lower case to ensure case-insensitive comparison
            std::transform(token.begin(), token.end(), token.begin(), ::tolower);

            // Check if the token matches the word to count
            if (token == wordToCount) {
                ++count;
            }
        }
    }

    file.close();
    return count;
}

int main() {
    std::string filePath;
    std::string wordToCount;

    // Input from user
    std::cout << "Enter the path to the file: ";
    std::cin >> filePath;

    std::cout << "Enter the word to count: ";
    std::cin >> wordToCount;

    // Call function and print result
    int occurrenceCount = countWordOccurrences(filePath, wordToCount);
    if (occurrenceCount != -1) {
        std::cout << "The word '" << wordToCount << "' occurs " << occurrenceCount << " times in the file." << std::endl;
    }

    return 0;
}
```

### How It Works

1. **Reading the File**: The `std::ifstream` object is used to open the file. If the file cannot be opened, it returns an error.

2. **Tokenizing Lines**: Each line is split into tokens using `std::istringstream`.

3. **Case Insensitivity**: By converting all characters to lowercase, we ensure that our word matching is case-insensitive.

4. **Incrementing Count**: Every time the specified word (`wordToCount`) is found, the count is incremented.

5. **Closing the File**: After processing all lines, the file is closed.

